import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { VendorContext } from '../context/VendorContext';
import { useContext } from 'react';

const DashNavBar = () => {
  const [showSidebar, setShowSidebar] = useState(false);
  const navigate = useNavigate();
  const { auth } = useAuth();
  const { vendor, loading } = useContext(VendorContext);

  const handleClose = () => {
    setShowSidebar(false);
  };

  const handleLogoClick = () => {
    if (vendor?._id) {
      navigate(`/vendor/${vendor._id}/menu`);
    }
  };

  // Profile Menu Items
  const menuItems = [
    {
      title: 'Store Info',
      items: [
        { label: 'Dispensary Name', value: vendor?.dispensaryName },
        { label: 'Business Type', value: vendor?.dispensaryType },
        { label: 'License Number', value: vendor?.license || 'Not provided' }
      ]
    },
    {
      title: 'Contact Info',
      items: [
        { label: 'Email', value: vendor?.email },
        { label: 'Phone', value: vendor?.contactNumber?.formatted }
      ]
    },
    {
      title: 'Business Settings',
      items: [
        { label: 'Minimum Order', value: `$${vendor?.minOrder || 0}` },
        { label: 'Tax Rate', value: `${vendor?.taxRate || 0}%` }
      ]
    }
  ];

  return (
    <>
      {/* Main Navbar */}
      <nav className="fixed top-0 left-0 right-0 h-16 bg-zinc-900 shadow-lg z-30">
        <div className="h-full px-4 mx-auto flex items-center justify-between">
          {/* Left - Company Logo */}
          <div className="flex items-center">
            <img
              src={require('../assets/images/miniLogo.jpg')}
              alt="Mini Logo"
              className="h-9 w-auto rounded-md cursor-pointer hover:opacity-90 transition-opacity"
              onClick={handleLogoClick}
            />
          </div>

          {/* Right - Greeting and Profile */}
          <div className="flex items-center space-x-4">
            {!loading && vendor && (
              <span className="text-white text-sm md:text-base">
                Hi, <span className="font-medium">{vendor.firstName}</span>
              </span>
            )}
            <button
              onClick={() => setShowSidebar(true)}
              className="relative w-10 h-10 rounded-full overflow-hidden hover:ring-2 hover:ring-blue-400 transition-all focus:outline-none"
            >
              <img
                src={vendor?.logoUrl || '/placeholder-image.png'}
                alt="Vendor Logo"
                className="w-full h-full object-cover"
              />
            </button>
          </div>
        </div>
      </nav>

      {/* Overlay */}
      {showSidebar && (
        <div
          className="fixed inset-0 bg-black/50 backdrop-blur-sm z-40 transition-opacity"
          onClick={handleClose}
        />
      )}

      {/* Enhanced Sidebar */}
      <aside
        className={`fixed top-0 right-0 w-80 h-full bg-white shadow-lg z-50 transform transition-transform duration-300 ease-in-out ${
          showSidebar ? 'translate-x-0' : 'translate-x-full'
        }`}
      >
        <div className="h-full flex flex-col">
          {/* Header */}
          <div className="px-6 py-4 border-b border-gray-200 bg-gray-50">
            <div className="flex items-center justify-between">
              <div className="flex items-center space-x-3">
                <div className="w-12 h-12 rounded-full overflow-hidden">
                  <img
                    src={vendor?.logoUrl || '/placeholder-image.png'}
                    alt="Profile"
                    className="w-full h-full object-cover"
                  />
                </div>
                <div>
                  <h2 className="text-lg font-semibold text-gray-800">
                    {vendor?.firstName} {vendor?.lastName}
                  </h2>
                  <p className="text-sm text-gray-500">{vendor?.email}</p>
                </div>
              </div>
              <button
                onClick={handleClose}
                className="p-2 hover:bg-gray-200 rounded-full transition-colors focus:outline-none"
                aria-label="Close sidebar"
              >
                <svg
                  className="w-5 h-5 text-gray-500"
                  fill="none"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  viewBox="0 0 24 24"
                  stroke="currentColor"
                >
                  <path d="M6 18L18 6M6 6l12 12"></path>
                </svg>
              </button>
            </div>
          </div>

          {/* Content */}
          <div className="flex-1 overflow-y-auto">
            <div className="p-6 space-y-6">
              {menuItems.map((section, idx) => (
                <div key={idx} className="space-y-4">
                  <h3 className="text-sm font-medium text-gray-500 uppercase tracking-wider">
                    {section.title}
                  </h3>
                  <div className="bg-white rounded-lg border border-gray-200 divide-y divide-gray-200">
                    {section.items.map((item, itemIdx) => (
                      <div key={itemIdx} className="p-4">
                        <div className="text-sm text-gray-500">{item.label}</div>
                        <div className="mt-1 text-sm font-medium text-gray-900">
                          {item.value}
                        </div>
                      </div>
                    ))}
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Footer Actions */}
          <div className="p-6 border-t border-gray-200 bg-gray-50">
            <button
              onClick={() => {
                // Handle deactivate logic
              }}
              className="w-full px-4 py-2 text-sm font-medium text-red-600 bg-red-50 rounded-lg hover:bg-red-100 transition-colors"
            >
              Deactivate Account
            </button>
          </div>
        </div>
      </aside>
    </>
  );
};

export default DashNavBar;
